import React from "react";
import { IoIosTimer } from "react-icons/io";

const Head = () => {
  return (
    <>
      <h2 class="heading--2">Recipe ingredients</h2>
      <div style={{ display: "flex" }}>
        <div>
          <IoIosTimer /> 75 MINUTE
        </div>
        <div>4 SERVINGS</div>
      </div>
    </>
  );
};

export default Head;
